import React from "react";
import placeholder from ".././Img/placeholder.jpg";
import "./Onas.css";

const Onas = () => {
  return (
    <div className="onasmain">
      <img className="placeholders" src={placeholder} />
      <img className="placeholders" src={placeholder} />
      <img className="placeholders" src={placeholder} />
      <img className="placeholders" src={placeholder} />
      <img className="placeholders" src={placeholder} />
      <img className="placeholders" src={placeholder} />
    </div>
  );
};

export default Onas;
